	<style>
	body {
    font-family: 'Open Sans', sans-serif;
    color: #535353;
}

.img-fluid {
    max-width: 100% !important;
    height: auto;
}

.form-control:focus {
    box-shadow: none;
}

.login-box .alert{
    padding: 15.5px 20px;
    font-size: 13px;
    border: none !important;
    border-radius: 3px;
    margin-bottom: 25px;
}

.login-box .alert-dismissible .btn-close{
    padding: 18.5px 19px;
    background-size: 8px;
}

.login-box .alert-dismissible .btn-close:focus,
.login-box .alert-dismissible .btn-close:active {
    box-shadow: none;
}

.login-box .password-indicator {
    position: absolute;
    right: 15px;
    top: 17px;
    cursor: pointer;
    visibility: hidden;
    opacity: 0;
    transition: visibility 0s linear 300ms, opacity 500ms;
    font-size: 17px;
    color: #999;
}

.login-box .password-wrapper:hover .password-indicator{
    visibility: visible;
    opacity: 1;
    transition: visibility 0s linear 0s, opacity 500ms;
    font-size: 17px;
    color: #555;
}

.login-box .login-popover{
    font-size: 14px;
    color: #777;
    cursor: help;
}

.login-box .login-popover-abs{
    position: absolute;
    right: 15px;
    top: 15px;
}

.popover {
    border: 1px solid #ebeef5 !important;
    box-shadow: 0 2px 12px 0 rgb(0 0 0 / 10%);
}

.popover-header {
    box-shadow: none;
    border: 0px;
    background: #fff;
    color: #555;
    font-size: 15px;
    font-family: 'Jost', sans-serif;
    padding-bottom: 5px;
}

.popover-body {
    padding: 5px 10px 10px 16px;
    color: #777;
    font-size: 13px;
}

.login-box .form-group label.error{
    font-size: 13px;
    text-align: left;
    color: #535353;
    width: 100%;
}

/** Login 26 start **/
.login-26 {
  //  background: url(img-7.jpg) top left repeat;
    background-size: cover;
    top: 0;
    width: 100%;
    text-align: center;
    bottom: 0;
    opacity: 1;
    z-index: 999;
    min-height: 100vh;
    position: relative;
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 30px 0;
}

.login-26 .form-section {
    max-width: 550px;
    margin: 0 auto;
    padding: 70px 50px;
    background: #fff;
    border-radius: 5px;
    box-shadow: 0 0 35px rgba(0, 0, 0, 0.1);
    z-index: 999;
}

.login-26 #particles-js {
    background-size: cover;
    background-position: 50% 50%;
    position: fixed;
    min-height: 100vh;
    width: 100%;
    z-index: -999;
}

.login-26 .form-section p{
    color: #535353;
    margin-bottom: 0;
    text-align: center;
    font-size: 16px;
}

.login-26 h1, h2, h3, h4, h5, h6, .h1, .h2, .h3, .h4, .h5, .h6 {
    font-family: 'Jost', sans-serif;
}

.login-26 .form-section a {
    text-decoration: none;
}

.login-26 .form-section p a{
    color: #535353;
    font-weight: 500;
}

.login-26 .form-section .extra-login {
    float: left;
    width: 100%;
    margin: 25px 0 25px;
    text-align: center;
    position: relative;
}

.login-26 .form-section .extra-login::before {
    position: absolute;
    left: 0;
    top: 10px;
    width: 100%;
    height: 1px;
    background: #d8dcdc;
    content: "";
}

.login-26 .form-section .extra-login > span {
    width: auto;
    float: none;
    display: inline-block;
    background: #fff;
    padding: 1px 20px;
    z-index: 1;
    position: relative;
    font-size: 15px;
    color: #535353;
    text-transform: capitalize;
}

.login-26 .form-section ul{
    list-style: none;
    padding: 0;
    margin: 0 0 20px;
}

.login-26 .logo-2 img{
    margin-bottom: 20px;
    height: 30px;
}

.login-26 .form-section .social-list li {
    display: inline-block!important;
    margin-bottom: 5px;
}

.login-26 .form-section .social-list li a {
    font-size: 14px;
    font-weight: 400;
    width: 130px;
    margin: 2px 0 3px 0;
    height: 40px;
    line-height: 40px;
    border-radius: 20px;
    display: inline-block;
    text-align: center;
    text-decoration: none;
    background: #fff;
    box-shadow: 0 0 5px rgba(0, 0, 0, 0.2);
    font-family: 'Jost', sans-serif;
}

.login-26 .form-section .social-list li a i{
    height: 40px;
    width: 40px;
    line-height: 40px;
    float: left;
    color: #fff;
    border-radius: 20px;
}

.login-26 .form-section .social-list li a span{
    margin-right: 7px;
}

.login-26 .form-section .thembo{
    margin-left: 4px;
}

.login-26 .form-section h3 {
    margin: 0 0 30px;
    font-size: 25px;
    font-weight: 400;
    color: #040404;
}

.login-26 .main-title .words-wrapper b {
    display: inline-block;
    position: absolute;
    white-space: nowrap;
    left: 0;
    top: 0;
}

.login-26 .main-title .words-wrapper b.visible {
    position: relative;
}

.login-26 .main-title .no-js .words-wrapper b {
    opacity: 0;
}

.login-26 .main-title .no-js .words-wrapper b.visible {
    opacity: 1;
}

.login-26 .main-title .headline{
    margin: 0 0 30px;
    font-size: 25px;
    font-weight: 400;
    color: #313131;
}

.login-26 .main-title .headline b {
    opacity: 0;
    font-weight: 400;
}

.login-26 .main-title .headline b.visible {
    top: 0;
    opacity: 1;
    -webkit-animation: slide-in 0.6s;
    -moz-animation: slide-in 0.6s;
    animation: slide-in 0.6s;
}

.login-26 .main-title .headline b.is-hidden {
    -webkit-animation: slide-out 0.6s;
    -moz-animation: slide-out 0.6s;
    animation: slide-out 0.6s;
}

.login-26 .main-title .visible{
    color: #01c5ff;
}

@-webkit-keyframes slide-in {
    0% {
        opacity: 0;
        -webkit-transform: translateY(-100%);
    }
    60% {
        opacity: 1;
        -webkit-transform: translateY(20%);
    }
    100% {
        opacity: 1;
        -webkit-transform: translateY(0);
    }
}

.login-26 .form-section .form-group {
    margin-bottom: 25px;
}

.login-26 .form-section .form-control {
    float: left;
    width: 100%;
    padding: 12px 20px 12px 20px;
    height: 50px;
}

.login-26 .form-section .form-control {
    font-size: 16px;
    outline: none;
    background: #e8e8e8;
    color: #535353;
    border-radius: 3px;
    border: 1px solid #e8e8e8;
}

.login-26 .form-section .checkbox .terms{
    margin-left: 3px;
}

.login-26 .form-section button:focus {
    outline: none;
    outline: 0 auto -webkit-focus-ring-color;
}

.login-26 .form-section .terms{
    margin-left: 3px;
}

.login-26 .form-section .form-check-input {
    width: 20px;
    height: 20px;
    margin-top: 0;
    position: absolute;
    border: 1px solid #e8e8e8;
    border-radius: 2px;
    background-color: #e8e8e8;
    margin-left: -22px;
}

.login-26 .form-section .checkbox {
    margin-bottom: 20px;
}

.login-26 .form-section .form-check{
    margin-bottom: 0;
    text-align: left;
}

.login-26 .form-section .form-check a {
    color: #535353;
}

.login-26 .form-section .form-check-label {
    padding-left: 5px;
    margin-bottom: 0;
    font-size: 16px;
    color: #535353;
}

.login-26 .form-check-input:checked {
    background-color: #01c5ff;
    border-color: #01c5ff;
}

.login-26 .form-section a.forgot-password {
    font-size: 16px;
    color: #535353;
}

.login-26 .btn-theme {
    color: #fff;
    text-align: center;
    border: 2px solid transparent;
    display: inline-block;
    position: relative;
    z-index: 1;
    transition: all .7s ease;
    border-radius: 3px;
    font-size: 17px;
    font-weight: 400;
    font-family: 'Jost', sans-serif;
    width: 50%;
}

.login-26 .btn-theme:before {
    position: absolute;
    content: "";
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    opacity: 0;
    visibility: hidden;
    transition: all .7s ease;
    z-index: -1;
    border-radius: 3px;
}

.login-26 .btn-theme:after {
    position: absolute;
    content: "";
    top: 0;
    right: 0;
    width: 100%;
    height: 100%;
    opacity: 0;
    visibility: hidden;
    transition: all .7s ease;
    z-index: -1;
}

.login-26 .btn-theme:hover {
    background: transparent;
}

.login-26 .btn-theme:hover:before {
    width: 0;
    opacity: 1;
    visibility: visible;
}

.login-26 .btn-theme:hover:after {
    width: 0;
    opacity: 1;
    visibility: visible;
}

.login-26 .btn-lg{
    padding: 0 50px;
    line-height: 46px;
}

.login-26 .btn{
    box-shadow: none!important;
}

.login-26 .btn-md{
    padding: 0 45px;
    line-height: 41px;
}

.login-26 .btn-primary {
    background: #01c5ff;
}

.login-26 .btn-primary:before {
    background: #01c5ff;
}

.login-26 .btn-primary:after {
    background: #01c5ff;
}

.login-26 .btn-primary:hover {
    color: #01c5ff;
    border: 2px solid #01c5ff;
}

/** Social media **/
.login-26 .facebook-i {
    background: #4867aa;
    color: #fff;
}

.login-26 .twitter-i {
    background: #33CCFF;
    color: #fff;
}

.login-26 .google-i {
    background: #db4437;
    color: #fff;
}

.login-26 .facebook-color{
    color: #4867aa;
}

.login-26 .twitter-color {
    color: #33CCFF;
}

.login-26 .google-color {
    color: #db4437;
}

@media (max-width: 768px) {
    .login-26 .form-section {
        padding: 50px 30px;
    }
}

@media (max-width: 500px) {
    .login-26 .form-section .social-list li a i {
        display: none;
    }

    .login-26 .form-section .social-list li a {
        width: 100px;
    }
}
/** Login 26 end **/
